INSERT INTO `sugestii` VALUES (1,'Friday 23 / 07 / 2010 |17:59:20|\nIn legatura cu AsociaÅ£ia profesorilor ÅŸi elevilor Colegiului \"Emil RacoviÅ£Äƒ\" as avea o multime de observatii de facut:\r\n- nu apare nicaieri pe sait un statut al acestei asociatii\r\n- nu apare nicaieri cine o conduce\r\n- nu apare nici o adresa de e-mail pentru a va putea scrie\r\n- nu apare nici un numar de telefon la care poate fi contactata acesta asociatie\r\n- nu apare nicaieri lista profesorilor si absolventilor care fac parte din aceasta asociatie\r\n\r\nInitiativa domnului director Voda, care inainte de a deveni cadru didactic la liceul nostru a  fost asistent la catedra de fizica din cadrul Universitatii Tehnice Cluj, este laudabila, insa nu a fost continuata cu consecventa si sufera de amatorism.\r\n\r\nAstept raspunsul dumneavoastra.\r\n\r\nCu stima,\r\nProf.Dr.Taciulescu Elinor\r\n\r\nGermania\r\nelinor@taciulescu.eu\r\nwww.taciulescu.eu\r\n'),(2,'Saturday 14 / 08 / 2010 |20:48:51|\n');
/*!40000 ALTER TABLE `sugestii` ENABLE KEYS */;
